QUICK MEALS WITH HIGH PROTEIN

I have said it before and I’ll keep on repeating the importance of protein! Protein is needed for blood sugar regulation, building and repairing muscles and for hormone balance. 

It’s wise to aim for 20-30 grams of protein at every meal, depending on your own bodies needs. More if you are active and a little less if you are sedentary. But so many things factor into what amount your body needs. 

Here are a few meal or food choices that will get you an instant 20-30 grams of protein. Remember that protein goes hand in hand with carbohydrates and healthy fats to create a well-balanced meal. 

